import React from 'react';
import './styles/PostsContainerPostsView.css'

const PostsContainer = ({ posts }) => {
    const fields = [
        'Link', 'Views', 'Engagement', 'Comments', 'Date'
    ]

    return (
        <div className="PostsContainerPostsView">
            {
                Object.keys(posts[0]).map((field, keyIndex) => (
                    <div className="PostsContainerPostsView-post-field" key={keyIndex}>
                        { field }
                    </div>
                ))
            }
            { posts.map((post, postIndex) => (
                <div className="PostsContainerPostsView-post" key={postIndex}>
                    {
                        Object.values(post).map((value, fieldIndex) => (
                            <div className="PostsContainerPostsView-post-field" key={fieldIndex}>
                                { value }
                            </div>
                        ))
                    }
                </div>
            )) }
        </div>
    );
}

export default PostsContainer;
